import React from 'react';

// Define a functional component to render a single schedule entry
const ScheduleRow = ({ slNo, date, batchID, time, link }) => {
  return (
    <tr>
      <td>{slNo}</td>
      <td>{date}</td>
      <td>{batchID}</td>
      <td>{time}</td>
      <td><a href={link} target="_blank" rel="noopener noreferrer">{link}</a></td>
    </tr>
  );
};

// Define a functional component to render the entire schedule table
const ScheduleTable = ({ scheduleData }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>SlNo</th>
          <th>Date</th>
          <th>BatchID</th>
          <th>Time</th>
          <th>Link</th>
        </tr>
      </thead>
      <tbody>
        {scheduleData.map((scheduleItem, index) => (
          <ScheduleRow
            key={index}
            slNo={scheduleItem.slNo}
            date={scheduleItem.date}
            batchID={scheduleItem.batchID}
            time={scheduleItem.time}
            link={scheduleItem.link}
          />
        ))}
      </tbody>
    </table>
  );
};

export default ScheduleTable;
